import AdminDashboard from '../AdminDashboard/admindashboard'
import './adminSellerMgmt.css'
import { useState, useEffect } from 'react';

const AdminSellerMgmt = () => {

    const [showCart, setShowCart] = useState([]);

    const tableHeading = (showCart,key) => {
        const value = Object.keys(showCart[0]);
        for (let index = 0; index < value.length; index++) {
            console.log("IMAGE: ", value[index]);
        }
        return (
            <>
                <thead key={key}>
                    <tr>
                        {
                            value.map((item, index) => (
                                <th className='mx-2 bg-info border' key={index} >{item} </th>
                            ))
                        }
                    </tr>
                    {tableBody(value)}
                </thead>
            </>
        )
    }

    const tableBody = (value) => {
        // const datas = Object.values(showCart);
        // for (let indexs = 0; indexs < datas.length; indexs++) {
        //     console.log("Datas: ", datas[indexs]);
        // }
        return (
            <>
                {
                    showCart.map((item, index) => (
                        <tr className='' key={index} className='tab' >
                            {
                                showCart.map((item, index) => (
                                    <td key={index}>{item.type} </td>
                                ))
                            }
                        </tr>
                    ))
                }
            </>
        )
    }

    const SellerDetails = () => {

        return (
            <>
                <div className='sellermgmt'>
                    <div>
                        <p>Admin seller Manangement</p>
                    </div>
                    <div className='sellerDetails'>
                        <p>Data</p>
                        <table className='table bg-info'>
                            {
                                showCart.map((item, index) => (
                                    index === 0 ? tableHeading(showCart,index) : null
                                ))
                            }
                        </table>
                    </div>
                </div >
            </>
        )
    }

    const cartImage = (API) => {
        fetch('http://localhost:3333/realestate/cartimage')
            .then(async (res) => {
                const cart = await res.json();
                return cart;
            })
            .then((cart) => {
                console.log("Image data : ", cart.data);
                setShowCart(cart.data);
            })
            .catch((err) => {
                console.log("Cart image: ", err.message);
            })
    }

    useEffect((e) => {
        cartImage();
    }, [])

    return (
        <>
            <AdminDashboard />
            {SellerDetails()}
        </>
    )
}

export default AdminSellerMgmt;
